section.logo-layout {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 200px;
  width: 100%;
}
section.logo-layout img {
  max-width: 125px;
  height: auto;
}
section.logo-layout small {
  color: #fff;
  font-size: 14px;
}

/* Start Navigation */
.nav-wrapper {
  display: flex;
  justify-content: center;
}
.nav-wrapper li {
  padding: 0 2.5rem;
}
.nav-wrapper li a {
  text-transform: uppercase;
  letter-spacing: 1px;
}

/* Start Header */
.sidenav-trigger {
  position: fixed;
  top: 15px;
  left: 15px;
  z-index: 3;
}
.sidenav-trigger i {
  font-size: 32px;
  color: #c5e1a5;
}

header {
  margin-top: 2rem;
}
header .card-image {
  background: url(84000f7da54ceb2a2860a1fdd9883ae5.jpg) center/cover;
  height: 290px;
}
header .card-image .card-title {
  font-size: 32px;
  font-weight: 500;
}

/* Start Latest works */
.latest-works .container {
  border-top: 1px solid rgba(0, 0, 0, 0.1);
}
.latest-works h2 {
  font-size: 28px;
  color: #689f38;
  margin-top: 24px;
  margin-bottom: 0;
}
.latest-works .work,
.all-works .work {
  margin-top: 35px;
}

.latest-works .work .card .card-image img,
.all-works .work .card .card-image img {
  min-height: 173px;
}
.latest-works .view-btn {
  margin: 35px 0;
}

/* Start footer */
footer {
  padding: 1.5rem 0;
}
footer .row {
  margin-bottom: 0;
}
footer small {
  color: #fff;
  font-size: 14px;
}

/* Contact Page */
.form {
  padding: 2rem;
}
.form h2 {
  font-size: 32px;
  font-weight: 500;
  color: #689f38;
  margin: 0;
}
.form p {
  margin-bottom: 0;
}
.form .card {
  margin-top: 2rem;
}
.form .card .card-content .card-title {
  font-weight: 500;
  font-size: 30px;
}
.form .card .card-content p {
  font-size: 16px;
  color: #689f38;
}
.form .card .card-content .btn {
  display: block;
  margin-left: auto;
}

/* About Page */
.about {
  padding: 3rem;
}
.about .card .card-content {
  display: flex;
  flex-wrap: wrap;
}
.about .card .card-content .head-image img {
  width: 100%;
  max-width: 200px;
  height: auto;
}
.about .card .card-content .head-text {
  padding: 1rem;
}
.about .card .card-content .head-text h4 {
  color: #689f38;
  margin-top: 0;
}

@media screen and (max-width: 600px) {
  header .card-image {
    max-height: 225px;
  }
  section.logo-layout {
    min-height: 130px;
  }
  section.logo-layout img {
    max-width: 70px;
  }
  .card .card-image .card-title {
    font-size: 22px;
  }
  .about .card .card-content .head-text h4 {
    font-size: 1.3rem;
  }
  .form h2 {
    font-size: 22px;
  }
  .form .card .card-content .card-title {
    font-size: 22px;
  }
  .form .card .card-content p {
    font-size: 14px;
  }
}
